&quot;XKCD&quot; Web Comic

&quot;XKCD&quot; (xkcd.com) by Randall Munroe describes itself as &quot;a webcomic of romance, sarcasm, math, and language.&quot;  Readers are cautioned: &quot;Warning: this comic occasionally contains strong language (which may be unsuitable for children), unusual humor (which may be unsuitable for adults), and advanced mathematics (which may be unsuitable for liberal-arts majors).&quot;

This torrent collects &quot;XKCD&quot; comics, from 2006 through the end of 2014.  The comics are compiled into a set of CBR files, one for each year.  (I've also included a CBR copy of the &quot;XKCD Volume 0&quot; collection, which reprints selected comics from 2006 through 2009 with additional commentary.)  Each comic's page includes its number, title and mouseover text.  A few (but only a few) comics' pages also include &quot;Editor's Notes&quot; providing context or explanation.  Where comics on the Web site link to larger images, the large image (except where completely impractical) is included in the CBR immediately following the smaller image
